etty big Area. We take buses every other day. It is really fun and exciting!! It is pretty\",\"3\":\"1579537558282\",\"4\":\"thread-f:1656265174498502061\",\"5\":[{\"1\":\"msg-f:1656265174498502061\",\"2\":{\"1\":1,\"2\":\"graham.smith@missionary.org\",\"3\":\"Graham Smith\"},\"5\":[{\"1\":1,\"2\":\"averyjs@gmail.com\"}],\"7\":\"1579537558282\",\"8\":\"New Area! New Baptism!\",\"9\":{\"2\":[{\"1\":0,\"3\":{\"2\":\"\\u003cdiv dir\\u003d\\\"ltr\\\"\\u003eWhat a Great week!!\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eI moved Areas and got a new companions!!\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eMy new area is called Eusebio Ayala. It is a pretty big Area. We take buses every other day. It is really fun and exciting!! It is pretty suburbs and super open. I love it!!\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eI have a couples stories I want to share from these past weeks!!\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e1 Rosalina- We just\\u00a0baptized my girl this past Saturday!! She is 70 years old and lives with one of her sons who has health problems. She lives 30 minutes from church and takes a bus each Sunday to come to church alone. I had the opportunity to teach her about the Gospel and explain the importance of the commandments!! She is so awesome and wants to be a light to those around her. She has 3 kids who are super inactive members...but she wants to help them come back to church to have an eternal family in the life to come!! She is super consistent\\u00a0in coming to church and is super excited to be a member. She has lost 2 of her 5 kids to diabetes and one is struggling. She has such great faith and wants to share it with others. She is showing such a true hear in changing her life to receive the blessings of the Gospel\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e2 We found a really awesome girl named Paula Yesterday!!! We were out contacting super far from our house. Being the Sabbath day, we could not buy any food and I was super duper hungry!! I was lacking a little energy because we had not been finding much success in this area. All the sudden, The house in front of us had a BIG old mango tree in their front yard! It was exactly what I wanted!! I clapped to ask to eat one of the mangos. We met Paula and she let us in. She is 25ish years old and lives with her brothers. We shared the restoration of the Gospel and the Book of Mormon. She had great questions of the Origin and how the Book of Mormon came to be. She is super awesome!! We are going back on Wednesday to she how she likes it. Little miracles like this keep me going.\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eSorry this email kinda sucks. I talked to my Mom and Dad for too much time today. I love and miss them.\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eThe computer and wifi suck so I am ending my email here and the photos do not work right now sorry...\\u003c/div\\u003e\\u003c/div\\u003e\\r\\n\"},\"4\":1258438979}],\"3\":0,\"7\":1,\"8\":0},\"10\":\"What a Great week!! I moved Areas and got a new companions!! My new area is called Eusebio Ayala. It is a pretty big Area. We take buses every other day. It is \",\"11\":[\"^all\",\"^i\",\"^io_unim\",\"^smartlabel_personal\",\"^sq_ig_i_personal\",\"^u\"],\"14\":\"\\u003cCACTCARacCqjQGUCfbTA++1rZa5ps_O--zHtwzC0YSWMmA-Kpdw@mail.gmail.com\\u003e\",\"18\":\"1579537558077\",\"19\":{\"1\":0,\"2\":0,\"3\":\"\",\"4\":-1,\"8\":\"missionary.org\",\"9\":\"missionary.org\",\"11\":1,\"17\":\"graham.smith@missionary.org\",\"18\":1},\"30\":{\"4\":{\"1\":1},\"5\":{\"1\":0.37099126},\"7\":{\"1\":\"21660255\"},\"8\":[21660255,21660332,40510093,40510189],\"10\":1},\"31 ":{\"1\":1,\"2\":\"averyjs@gmail.com\"},\"17\":\"1579489696410\",\"20\":{\"5\":2},\"35\":\"16fc0ec1a9ab5200\"},\"a\":3,\"b\":\"msg-f:1656214987903554048\",\"g\":8,\"e\":null},{\"i\":false,\"f\":false,\"c\":3,\"j\":\"1656265174498502061\",\"h\":null,\"d\":{\"3\":[{\"1\":1,\"2\":\"averyjs@gmail.com\"}],\"5\":\"New Area! New Baptism!\",\"6\":{\"2\":[{\"1\":0,\"3\":{\"2\":\"\\u003cdiv dir\\u003d\\\"ltr\\\"\\u003eWhat a Great week!!\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eI moved Areas and got a new companions!!\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eMy new area is called Eusebio Ayala. It is a pretty big Area. We take buses every other day. It is really fun and exciting!! It is pretty suburbs and super open. I love it!!\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eI have a couples stories I want to share from these past weeks!!\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e1 Rosalina- We just\\u00a0baptized my girl this past Saturday!! She is 70 years old and lives with one of her sons who has health problems. She lives 30 minutes from church and takes a bus each Sunday to come to church alone. I had the opportunity to teach her about the Gospel and explain the importance of the commandments!! She is so awesome and wants to be a light to those around her. She has 3 kids who are super inactive members...but she wants to help them come back to church to have an eternal family in the life to come!! She is super consistent\\u00a0in coming to church and is super excited to be a member. She has lost 2 of her 5 kids to diabetes and one is struggling. She has such great faith and wants to share it with others. She is showing such a true hear in changing her life to receive the blessings of the Gospel\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e2 We found a really awesome girl named Paula Yesterday!!! We were out contacting super far from our house. Being the Sabbath day, we could not buy any food and I was super duper hungry!! I was lacking a little energy because we had not been finding much success in this area. All the sudden, The house in front of us had a BIG old mango tree in their front yard! It was exactly what I wanted!! I clapped to ask to eat one of the mangos. We met Paula and she let us in. She is 25ish years old and lives with her brothers. We shared the restoration of the Gospel and the Book of Mormon. She had great questions of the Origin and how the Book of Mormon came to be. She is super awesome!! We are going back on Wednesday to she how she likes it. Little miracles like this keep me going.\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eSorry this email kinda sucks. I talked to my Mom and Dad for too much time today. I love and miss them.\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cdiv\\u003e\\u003cbr\\u003e\\u003c/div\\u003e\\u003c/div\\u003e\\u003cdiv\\u003eThe computer and wifi suck so I am ending my email here and the photos do not work right now sorry...\\u003c/div\\u003e\\u003c/div\\u003e\\r\\n\"},\"4\":1258438979}],\"3\":0,\"7\":1,\"8\":0},\"7\":\"What a Great week!! I moved Areas and got a new companions!! My new area is called Eusebio Ayala. It is a pretty big Area. We take buses every other day. It is \",\"8\":\"\\u003cCACTCARacCqjQGUCfbTA++1rZa5ps_O--zHtwzC0YSWMmA-Kpdw@mail.gmail.com\\u003e\",\"11\":{\"1\":0,\"2\":0,\"3\":\"\",\"4\":-1,\"8\":\"missionary.org\",\"9\":\"missionary.org\",\"11\":1,\"17\":\"graham.smith@missionary.org\",\"18\":1},\"17\":\"1579537558077\",\"20\":{\"5\":2},\"35\":\"16fc3c66a3d565ad\"},\"a\":4,\"b\":\"msg-f:1656265174498502061\",\"g\":8,\"e\":null},{\"i\":false,\"f\":false,\"c\":1,\"j\":\"1656299736887099138\",\"h\":null,\"d\":{\"1\":[{\"1\":1,\"2\":\"AVERYJS@gmail.com\"}],\"4\":[{\"1\":1,\"2\":\"reply-245088
